import React from 'react'; 
import PropTypes from 'prop-types';

const Header = (props) => {
    const { branding } = props ; 
    return (
    <div>
        <h1 style ={{color: 'red'}}>{branding}</h1>
    </div>
    );
}; 

Header.defaultProps = {
    branding: 'My App'
};

Header.propTypes = {
    branding: PropTypes.string.isRequired
}

export default Header;
